;`use strict`

import inquirer from 'inquirer'
import axios from 'axios'
import fs from 'fs'

export default async function run() {
    try {
        const { user, color } = await inquirer
            .prompt([
                { name: 'user', message: 'Github Username: ' },
                { name: 'color', message: 'Favorite Color: ' }
            ])
            .then(data => data)
        const data = await axios
            .get(`https://api.github.com/users/${user}`)
            .then(data => (data.data['color'] = color))
            .then(
                s.writeFileSync(
                    './user.json',
                    JSON.stringify(data, null, 2),
                    err => console.log(err ? err : '')
                )
            )
        // data+=`color: ${color}`
        const repo = await axios
            .get(`https://api.github.com/users/${user.data}/repos`)
            .then(data => data.data)
            .then(
                fs.writeFileSync(
                    './repo.json',
                    JSON.stringify(repo, null, 2),
                    err => console.log(err ? err : '')
                )
                // console.log(repo)
            )
        console.log('write complete')
    } catch (err) {
        return err
    }
}
run()

