;`use strict`

import get from '../scripts/utils'
import headTemplate from '../parts/head'
import imagesTemplate from '../parts/images'
const safeQuotes = str => str.replace(/"/g, '&quot;')
/*
 * data
 */
const repositories = get()
const repositoriesMore = 25
const canShowMoreRepositories =
    repositoriesMore && repositoriesMore < repositories.length

function generateRepositoriesHtml(repo) {
    var output = ''
    for (var i = 0; i < repo.length; i++) {
        output += `<div>
        <a href="${
            repo[i].html_url
        }" class="repository uk-card uk-card-default uk-card-small uk-card-hover"
            uk-scrollspy="cls: uk-animation-scale-up" target="_blank" rel="noopener">
          <div class="repository__name uk-card-title">${repo[i].full_name}</div>
          <p class="repository__description">${repo[i].description || '-'}</p>
          <div class="repository__bottom">
            <div class="repository__bottom__language">
              <span uk-icon="code"></span>
              <span>${repo[i].language || '-'}</span>
            </div>
            <div class="repository__bottom__star">
              <span uk-icon="star"></span>
              <span>${repo[i].stargazers_count}</span>
            </div>
            <div class="repository__bottom__forks">
              <span uk-icon="git-fork"></span>
              <span>${repo[i].forks_count}</span>
            </div>
          </div>
        </a>
      </div>`
    }
    return output
}

export const head = function generateHead() {
    let h = headTemplate()
    let i = imagesTemplate({
        avatar: get('avatar_url'),
        background: require('assets/background.png')
    })
    return `<head>
      ${h}
      ${i}
    </head>`
}

export const header = function generateHeader() {
    const social = [
        {
            name: 'Location',
            icon: 'map',
            link: `https://www.google.com/maps/@?api=1&map_action=map&query=${get(
                location
            )
                .split(' ')
                .join('+')}`
        },
        { name: 'Github', icon: 'github', link: get(url) },
        { name: 'Blog', icon: 'blog', link: get(blog) }
    ]
    if (config.data.socialMedia.length > 0) {
        var output = '<div class="header__wrap__social">'
        for (const media of social) {
            output += `<a href="${media.link}" title="${safeQuotes(
                media.name
            )}" target="_blank" rel="noopener">`
            let addr = require(`../asset/icons/${media.icon}.svg`)
            output += `${addr}</a>`
        }
        return a + output + '</div>'
    }
}
export const repo = function generateMain() {
    var partA, partB
    let repo = generateRepositoriesHtml(
        canShowMoreRepositories
            ? repositories.slice(0, repositoriesMore)
            : repositories
    )
    const main =
        get().length > 0
            ? `<section class="repositories-section uk-section uk-section-default">
      <div class="uk-container">
        <h2 class="uk-heading-line">
          <span>
            <span uk-icon="grid"></span>
            <span>Repositories</span>
          </span>
        </h2>
        <div class="repositories uk-child-width-1-3@l uk-child-width-1-2@m uk-grid-small" uk-grid="masonry: true">
           ${repo}
        </div>`
            : ''
    const sub = canShowMoreRepositories
        ? `<div class="show-more-wrap">
            <button id="github-more" class="uk-button uk-button-default">Show more</button>
          </div>
         }
      </div>
    </section>`
        : ''
    return `<main>
      ${main}
      ${sub}
    </main>`
}

export const date = new Date().toLocaleDateString(undefined, {
    year: 'numeric',
    day: '2-digit',
    month: '2-digit'
})

export const more = canShowMoreRepositories
    ? generateRepositoriesHtml.toString()
    : ''
export function render() {
    const h2e = function(html) {
        var template = document.createElement('template')
        template.innerHTML = html
        return template.content.childNodes
    }

    if (canShowMoreRepositories) {
        var repositories = JSON.stringify(modules.github.repositories)
    }

    window.addEventListener('DOMContentLoaded', function() {
        if (canShowMoreRepositories) {
            var btnMoreGithubRepsEl = document.querySelector('#github-more')
            if (btnMoreGithubRepsEl) {
                var sectionGithubRepsEl = document.querySelector(
                    '.repositories'
                )
                var per_page = repositoriesMore
                var len = repositories.length
                var page = 1
                btnMoreGithubRepsEl.addEventListener('click', function() {
                    var current = page * per_page
                    var next = current + per_page
                    var html = generateRepositoriesHtml(
                        repositories.slice(current, next)
                    )
                    var nodes = h2e(html)
                    for (var i = 0; i < nodes.length; i++) {
                        sectionGithubRepsEl.append(nodes[i])
                    }
                    if (len <= next) {
                        var showMoreWrapEl = document.querySelector(
                            '.repositories-section .show-more-wrap'
                        )
                        if (showMoreWrapEl) {
                            showMoreWrapEl.remove()
                        }
                    }
                    page++
                })
            }
        }
    })
}

export default function createHtml(page) {
    return `<!DOCTYPE html>
  <html lang="en" data-template="default" data-compiled="${Date.now()}">
  ${page.head}
<body>
<header>
  <div class="header__background uk-background-cover background--image" uk-parallax="bgy: -100"></div>
  <div class="header__wrap">
    <div class="header__wrap__image">
      <div class="avatar--image uk-background-cover"></div>
    </div>
    <h1 class="header__wrap__name uk-h1"><${page.name}></h1>
    ${page.header}
    </div>
</header>
${page.repo}
<footer>
  <hr class="uk-divider-icon">
  <span>${page.date}</span>
</footer>
${page.more}
<script
  src="https://code.jquery.com/jquery-3.4.1.min.js"
  integrity="sha256-CSXorXvZcTkaix6Yvo6HppcZGetbYMGWSFlBw8HfCJo="
  crossorigin="anonymous"></script>
<script src="index.js"></script>
</body>
</html>`
}

