        var output = '<div class="header__wrap__social">'
        for (const media of social) {
            output += `<a href="${media.link}" title="${safeQuotes(
                media.name
            )}" target="_blank" rel="noopener">`
            let addr = require(`../asset/icons/${media.icon}.svg`)
            output += `${addr}</a>`
        }
        return a + output + '</div>'
    }
}
export const repo = function generateMain() {
    var partA, partB
    let repo = generateRepositoriesHtml(
        canShowMoreRepositories
