;`use strict`

import inquirer from 'inquirer'
import axios from 'axios'
import fs from 'fs'

export default async function run() {
    try {
        console.log('it did try')
        inquirer
            .prompt([
                { name: 'user', message: 'Github Username: ' },
                { name: 'color', message: 'Favorite Color: ' }
            ])
            .then(data => {
                console.log(`color is ${data.color}`)
                var color = data.color
                axios
                    .get(`https://api.github.com/users/${data.user}`)
                    .then(data => {
                        console.log(`color is ${color}`)
                        data.data['color'] = color
                        fs.writeFileSync(
                            './user.json',
                            JSON.stringify(data.data, null, 2),
                            err => console.log(err ? err : '')
                        )
                        console.log('write user complete')
                    })
                axios
                    .get(`https://api.github.com/users/${data.user}/repos`)
                    .then(data => {
                        fs.writeFileSync(
                            './repo.json',
                            JSON.stringify(data.data, null, 2),
                            err => console.log(err ? err : '')
                        )
                        console.log('write complete')
                    })
            })
    } catch (err) {
        return err
    }
}

